import React from 'react';
import {DeleteIcon} from '@material-ui/icons'
import {Link} from 'react-router-dom';

class PageLayout extends React.Component {
  render() {
    const menus = [
      { text: 'events', icon: <DeleteIcon />, link: '/events' },
      { text: 'stations', icon: <DeleteIcon />, link: '/stations' },
      {
        text: 'accounts',
        icon: <DeleteIcon />,
        link: '/accounts',
      },
    ];
    return (
        <React.Fragment>
          {menus.map(menuItem => (
            <React.Fragment>
              <Link to={menuItem.link}>{menuItem.icon}{menuItem.text}</Link>
            </React.Fragment>
          ))}

          {this.props.children}
        </React.Fragment>
    );
  }
}

export default PageLayout;
